import ApexCharts from "react-apexcharts";
import $ from 'jquery';
function Chart() {

  const charts = {
    chart: {
      type: 'bar',
      height: 350
    },
    series: [{
      data: [{
        x: 'category A',
        y: 10
      }, {
        x: 'category B',
        y: 18
      }, {
        x: 'category C',
        y: 13
      }]
    }],
    xaxis: {
      categories: ['Feb', 'Mar', 'Apr', 'May', 'Jun', 'Jul', 'Aug', 'Sep', 'Oct'],
    },
  }

    return <ApexCharts
    options={charts}
    series={charts.series}
    typs={charts.chart}
    width={800}
    height={300}
    />
}
export default Chart;
